url &lt;- 'https://www2.census.gov/programs-surveys/popest/datasets/2020-2024/state/totals/NST-EST2024-ALLDATA.csv'

read_csv(url) |&gt;
  select(name = NAME, pop2024 = POPESTIMATE2024) |&gt;
  mutate(pop2024_per100k = pop2024 / 100000) -&gt;
  pop

