Life Expectancy Improvement



gapminder |&gt;
  select(country, year, lifeExp) |&gt;
  group_by(country) |&gt;
  mutate(le_delta = lifeExp - lag(lifeExp)) |&gt;
  summarize(worst_le_delta = min(le_delta, na.rm = TRUE)) |&gt;
  top_n(-1, wt = worst_le_delta)



